import sys

def solve():
    n = int(input())
    a = [int(i) for i in input().split()]

    v = a[0] if a[0] > 0 else 1
    ans1 = abs(a[0] - v)

    for i in range(1, n):
        if v * (v + a[i]) < 0:
            v += a[i]
            continue
        else:
            if v < 0:
                ans1 += abs(v + a[i] - 1)
                v = 1
            else:
                ans1 += abs(v + a[i] + 1)
                v = -1

    v = a[0] if a[0] < 0 else -1
    ans2 = abs(a[0] - v)

    for i in range(1, n):
        if v * (v + a[i]) < 0:
            v += a[i]
            continue
        else:
            if v < 0:
                ans2 += abs(v + a[i] - 1)
                v = 1
            else:
                ans2 += abs(v + a[i] + 1)
                v = -1

    ans = min(ans1, ans2)

    print(ans)

if __name__ == '__main__':
    solve()

